package MetaCPAN::Plack::Login::ComicVine;
use strict;
use warnings;
use JSON::XS;
use base 'MetaCPAN::Plack::Login';

my $data_start = tell DATA;
my @lines;
push(@lines, $_) while(<DATA>);

sub type { 'comicvine' }

sub call {
    my ($self, $env) = @_;
    my $data = $lines[int(rand()*@lines)];
    my $extra = decode_json($data);
    $self->save_identity($env, undef, $extra);
    return $self->success;
}

1;

